import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import BlogPost from './components/BlogPost';

import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';

import axios from 'axios'
import Container from '@mui/material/Container';

function App() {
  const [blogPostData, setBlogPostData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/create-blogpost')
    .then(response => {
      console.log('Blogpost data: ', response.data);

      setBlogPostData(response.data);
    })
    .catch(error => {
      console.log('This is the error: ', error);
    });
  }, []);

  const getUserName = data => {
    if (null === data.user) {
      return '[USER DELETED]';
    } else {
      return data.user;
    }
  }

  const displayBlogPosts = () => {
    let posts;

    for (let i = 0; i < blogPostData.length; i++) {
      posts = <div>
        {posts} 
        <BlogPost title={blogPostData[i].title} text={blogPostData[i].text} username={getUserName(blogPostData[i])} />
      </div>;
    }

    return posts;
  }

  return (
    <React.Fragment>
      <Container maxWidth="lg">
        <Stack>
          {displayBlogPosts()}
        </Stack>
      </Container>
    </React.Fragment>
  );
}

export default App;
